import React from "react";
import { Link, useNavigate } from "react-router-dom";
import { useAuth } from "../context/AuthContext";
import "../Styles/Navbar.css";

export default function Navbar() {
  const { isAuthenticated, login, logout, account } = useAuth();
  const navigate = useNavigate();

  return (
    <nav className="navbar">
  <div className="navbar-links">
    <Link to="/" className="navbar-link">Home</Link>
    <Link to="/search" className="navbar-link">Search</Link>
    {isAuthenticated && (
      <Link to="/bookmarks" className="navbar-link">Bookmarks</Link>
    )}
  </div>

  <div className="navbar-right">
    {!isAuthenticated ? (
      <button onClick={login} className="navbar-button">Login</button>
    ) : (
      <>
        <button onClick={() => navigate("/profile")} className="navbar-button">
          Hi, {account?.name?.toUpperCase()}
        </button>
        <button onClick={logout} className="navbar-button">Logout</button>
      </>
    )}
  </div>
</nav>

  );
}
